import React from 'react'
import "./Footer.scss"

function Footer() {
  return (
    <div className="footer" id='footer'>
       <div className="footer__info"></div>
       <div className="footer__about"></div>
       <div className="footer__follow"></div>
    </div>
  )
}

export default Footer
